"use client";
import { useState, useRef, useEffect, forwardRef } from "react";
import { motion, useAnimationFrame, type SVGMotionProps } from "framer-motion";

const SMALL_SCREEN_VIEWBOX = {
  x: 300,
  y: 30,
  width: 800,
  height: 170,
};

const BIG_SCREEN_VIEWBOX = { x: 300, y: -120, width: 700, height: 300 };

interface Props {
  disableAnimation?: boolean;
  animationSpeed?: number;
}

export const AnimatedHeroStripe = ({
  disableAnimation,
  animationSpeed = 0.15,
}: Props) => {
  const containerRef = useRef<HTMLDivElement>(null);
  const stripeRef = useRef<SVGSVGElement>(null);
  const [viewBox, setViewBox] = useState(SMALL_SCREEN_VIEWBOX);

  useAnimationFrame((t) => {
    if (containerRef.current && stripeRef.current && !disableAnimation) {
      const containerWidth = containerRef.current.offsetWidth;
      const stripeWidth = stripeRef.current.getBBox().width;

      setViewBox((prevViewBox) => {
        const newX = prevViewBox.x + animationSpeed;

        if (newX >= stripeWidth - containerWidth) {
          return { ...prevViewBox, x: 0 };
        }

        return { ...prevViewBox, x: newX };
      });
    }
  });

  const updateViewBox = () => {
    const screenWidth = window.innerWidth;

    if (screenWidth >= 1024) {
      // Adjust the viewBox for desktop screens
      setViewBox(BIG_SCREEN_VIEWBOX);
    } else {
      // Use the default viewBox for smaller screens
      setViewBox(SMALL_SCREEN_VIEWBOX);
    }
  };

  useEffect(() => {
    updateViewBox();
    window.addEventListener("resize", updateViewBox);
    return () => {
      window.removeEventListener("resize", updateViewBox);
    };
  }, []);

  return (
    <div
      ref={containerRef}
      className="absolute bottom-0 -mx-4 -my-4 w-[calc(100%+2rem)] overflow-hidden"
    >
      <HeroStripe
        ref={stripeRef}
        viewBox={`${viewBox.x} ${viewBox.y} ${viewBox.width} ${viewBox.height}`}
      />
    </div>
  );
};

